<?phpnamespace App\Test\Unit\Formatter;use App\Service\Parser\APIParser;use App\Service\Parser\FileParser;use Doctrine\Common\Collections\ArrayCollection;use PHPUnit\Framework\TestCase;use Symfony\Bundle\FrameworkBundle\Test\WebTestCase;use Symfony\Contracts\HttpClient\HttpClientInterface;use Symfony\Contracts\HttpClient\ResponseInterface;class FileParserTest extends WebTestCase{    public function testParse()    {        $kernel = static::bootKernel();        $config = $kernel->getContainer()->getParameter('advertisers');        $config = new ArrayCollection($config['advertiserA']);        $parser = new FileParser();        $results = $parser->setConfig($config)->parse();        $this->assertIsArray($results);    }}